import React from 'react'
import AliceCarousel from 'react-alice-carousel';
import "react-alice-carousel/lib/alice-carousel.css";
import one from '../../pics/creative.svg';
import two from '../../pics/creative2.svg';
import three from '../../pics/em2.jpg';
import four from '../../pics/makeup.svg';
import five from '../../pics/film.svg';

const Carousel = () => {
    const carouselImgs = [
    { id: 1, src: one, title: 'one', description: 'first image'  },
    { id: 2, src: two, title: 'two', description: 'second image'  },
    { id: 3, src: three, title: 'three', description: 'third image'  },
    { id: 4, src: four, title: 'four', description: 'fourth image' },
    { id: 5, src: five, title: 'five', description: 'first image' },
    ];

    return (
        <>
            <AliceCarousel>
                <img src={one} alt='' className='sliderimg'> </img> \
                <img src={two} alt='' className='sliderimg'> </img> 
                <img src={three} alt='' className='sliderimg'> </img> 
                <img src={four} alt='' className='sliderimg'> </img> 
                <img src={five} alt='' className='sliderimg'> </img> 

            </AliceCarousel>
        </>
    )
}

export default Carousel
